window.bookSummaryJSON = "<p>The new United States in central Germany launches a one-plane Doolittle Raid on Paris, France. The target: their arch enemy, Cardinal Richelieu. Meanwhile, an ambassador from the Mughal Empire of northern India is being held captive in Austria by the Habsburg dynasty. Mike Stearns decides to send a mercenary company to rescue him, led by two 17th century mercenary officers: an Englishman and a Irishman, who seem to spend as much time fighting each other as they do the enemy.</p> <p>Mike Spehar's \"Collateral Damage\" and Chris Weber's \"The Company Men\" are just two of the stories contained in this second volume of the <i>Grantville Gazette</i>. In other stories:</p> <ul> <li>A prominent Italian musician decides to travel to Grantville to investigate the music of the future.</li> <li>An American archer and a Finnish cavalryman become friends in the middle of a battlefield.</li> <li>A Lutheran pastor begins a theological challenge to the establishment based on his interpretation of the Ring of Fire.</li> <li>American and German detectives become partners to investigate a murder.</li> </ul> <p><b>Contains mature themes.</b></p>"; 
